import "./ErrorPage.css";
import HELI_FRONT from "./img/heli_front.svg";

class ErrorPage extends React.Component {
    render() {
        return (
        <div>
            <img src={HELI_FRONT}/>
            <img src={HELI_FRONT}/>
            <img src={HELI_FRONT}/>
        </div>
        )
    }
}

export default ErrorPage;
